                        getter: (s, p) => FormLinkBinaryTranslation.Instance.OverlayFactory<ISkyrimMajorRecordGetter>(p, s));
                    return (int)SkyrimModHeader_FieldIndex.OverriddenForms;
                }
                case RecordTypeInts.INTV:
                {
